description:
Sea Turtle Screensaver


Download and Enjoy this FREE SCREENSAVER

Now With Amazing Effects and Sound!





Sea Turtle Screensaver is a unique screensaver that will bring the Sea Turtle to your computer screen. With 14 wonderful and beautiful images of this fantastic marine reptile to bring to your life the fantastic ocean life.


*** 14 Amazing Scenarios.
*** High Quality Image and Effects.
*** Realistic Underwater Scenario.
*** High Quality Sound.
*** Full install/uninstall support.



